Live Animals 2008 

Verenigde Staten
Horror

Regie : Jeremy Benson
Met : John Still, Christian Walker, Jeanette Comans

Een groep studenten wordt gekidnapped door een niets ontzienende mensenhandelaar.
Ze krijgen de opdracht om ieder voor zich uit te maken welke waarde de vrijheid voor hen heeft en beslissen wat ze er voor over hebben om deze terug te krijgen...
